import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";

import PrivateRoute from '../../../utils/PrivateRoute';

import MusicCollection from '../../MusicCollection/MusicCollection';
import RegistrationForm from '../../Dialogs/RegistrationForm';
import LoginForm from '../../Dialogs/LoginForm';
import Header from '../Header/Header';
import Player from '../Player';
import { CURRENT_SONG_NAME, CURRENT_SONG_ID } from '../../../constants/apiConstants';

class MediaPlayer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            currentSongName: null,
            currentSongID: null,
        }
        this.updateCurrentSong = this.updateCurrentSong.bind(this);
    }

    updateCurrentSong(songName, songID) {
        this.setState({
            currentSongName: songName,
            currentSongID: songID,
        });
        console.log(this.state.currentSongName);
        sessionStorage.setItem(CURRENT_SONG_NAME, this.state.currentSongName);
        sessionStorage.setItem(CURRENT_SONG_ID, songID);
    }

    render() {
        return (
            <Router>
                <div>
                    <Header />
                    <Switch>
                        <Route path="/register">
                            <RegistrationForm />
                        </Route>
                        <Route path="/login">
                            <LoginForm />
                        </Route>
                        <PrivateRoute path="/">
                            <MusicCollection
                                updateCurrentSong={this.updateCurrentSong}
                            ></MusicCollection>
                            <Player
                                currentSongName={this.state.currentSongName ? this.state.currentSongName : sessionStorage.getItem(CURRENT_SONG_NAME)}
                                currentSongID={this.state.currentSongID ? this.state.currentSongID : sessionStorage.getItem(CURRENT_SONG_ID)}
                                changedFrequencyCallback={this.props.setCurrentFrequency}
                            >
                            </Player>
                        </PrivateRoute>
                    </Switch>
                </div>
            </Router>
        );
    }
}

export default MediaPlayer;
